import { Component } from "@angular/core";

@Component({
  selector: "app-navbar",
  templateUrl: "./navbar.component.html",
  styleUrls: ["./navbar.component.scss"],
})
export class NavbarComponent {
  items = [
    {
      title: "Home",
      link: "",
      icon: "",
    },
    {
      title: "Proyectos",
      link: "",
      icon: "",
    },
    {
      title: "",
      link: "",
      icon: "",
    },
    {
      title: "",
      link: "",
      icon: "",
    },
    {
      title: "",
      link: "",
      icon: "",
    },
  ];
}
<nav id="nav">
  <div class="container">
    <img src="/assets/main.png" alt="not found" />

    <div class="items" *ngFor="let item of items">
      <div [routerLink]="item.link">
        {{ item.title }}
      </div>
    </div>
  </div>
</nav>
